import React, { useEffect, useState } from 'react'
import { clientId, clientSecret, endPoint, tokenEndPoint } from '../../Constants/constant'

function Libraryy() {

    const [token, setToken] = useState('')
    // const [playlists, setPlaylists] = useState([{}])

    useEffect(() => {
        // to fetch the access token from spotify api 
        var authParameters = {
            method: 'POST',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded'
            },
            body: 'grant_type=client_credentials&client_id=' + clientId + '&client_secret=' + clientSecret
        }

        fetch(tokenEndPoint, authParameters)
            .then(result => result.json())
            .then(data => setToken(data.access_token))
    }, [])

    // console.log(accessTokenShafiiq);

    useEffect(() => {
        async function getmy() {
            const myParams = {
                method: 'get',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': 'Bearer ' + token,
                }
            }

            fetch(`${endPoint}users/31q2bv54j4iegidrgzazvkewj3i4/playlists`, myParams)
                .then(result => console.log(result))
                .catch(err => console.log(err))
        }
        getmy()

    }, [{}])
  return (
    <div>
      
    </div>
  )
}

export default Libraryy
